import React, { useState } from 'react';
import axios from 'axios';

const AddItemForm = () => {
  const [category, setCategory] = useState('');
  const [name, setName] = useState('');
  const [usdPrice, setUsdPrice] = useState('');
  const [cryptocurrency, setCryptocurrency] = useState('BNB');
  const [network, setNetwork] = useState('ethereum');
  const [numberOfItems, setNumberOfItems] = useState('');
  const [text, setText] = useState('');
  const [mediaUrls, setMediaUrls] = useState({ images: [], videos: [] });

  const handleSubmit = async (e) => {
    e.preventDefault();

    const itemData = {
      category,
      item: {
        name,
        usdPrice,
        cryptocurrency,
        network,
        numberOfItems,
        images: mediaUrls.images,
        videos: mediaUrls.videos,
        text,
      },
    };

    try {
      await axios.post('http://localhost:3001/add-item', itemData);
      alert('Item added successfully!');
    } catch (error) {
      console.error('Error adding item:', error);
      alert('Failed to add item.');
    }
  };

  const handleImageUrlChange = (e) => {
    setMediaUrls((prevUrls) => ({
      ...prevUrls,
      images: e.target.value.split(',').map(url => url.trim()),  // Split by comma for multiple URLs
    }));
  };

  const handleVideoUrlChange = (e) => {
    setMediaUrls((prevUrls) => ({
      ...prevUrls,
      videos: e.target.value.split(',').map(url => url.trim()),  // Split by comma for multiple URLs
    }));
  };

  return (
    <form onSubmit={handleSubmit}>
      <div>
        <label>Category:</label>
        <input
          type="text"
          value={category}
          onChange={(e) => setCategory(e.target.value)}
          placeholder="e.g., electronics"
        />
      </div>

      <div>
        <label>Product Name:</label>
        <input
          type="text"
          value={name}
          onChange={(e) => setName(e.target.value)}
          placeholder="e.g., Smartphone"
        />
      </div>

      <div>
        <label>USD Price:</label>
        <input
          type="number"
          value={usdPrice}
          onChange={(e) => setUsdPrice(e.target.value)}
          placeholder="e.g., 100"
        />
      </div>

      <div>
        <label>Cryptocurrency:</label>
        <select
          value={cryptocurrency}
          onChange={(e) => setCryptocurrency(e.target.value)}
        >
          <option value="BNB">BNB</option>
          <option value="ETH">ETH</option>
          <option value="USDT">USDT</option>
        </select>
      </div>

      <div>
        <label>Network:</label>
        <select
          value={network}
          onChange={(e) => setNetwork(e.target.value)}
        >
          <option value="ethereum">Ethereum</option>
          <option value="binance">Binance Smart Chain</option>
        </select>
      </div>

      <div>
        <label>Number of Items:</label>
        <input
          type="number"
          value={numberOfItems}
          onChange={(e) => setNumberOfItems(e.target.value)}
          placeholder="e.g., 100"
        />
      </div>

      <div>
        <label>Text Description:</label>
        <textarea
          value={text}
          onChange={(e) => setText(e.target.value)}
          placeholder="e.g., This is the latest model."
        />
      </div>

      <div>
        <label>Image URLs (comma separated):</label>
        <input
          type="text"
          onChange={handleImageUrlChange}
          placeholder="e.g., https://link-to-image1, https://link-to-image2"
        />
      </div>

      <div>
        <label>Video URLs (comma separated):</label>
        <input
          type="text"
          onChange={handleVideoUrlChange}
          placeholder="e.g., https://link-to-video1, https://link-to-video2"
        />
      </div>

      <button type="submit">Add Item</button>
    </form>
  );
};

export default AddItemForm;
